import React from 'react';
import '../index';

const Card = ({ todoList }) => {

    if(!todoList) {
        return (
            <div id="card-wrap">
                Add a todo
            </div>
        )
    } else {
        return (
            <div id="card-wrap">
                <ul>
                {todoList.map((todo) => {
                    return <li id={todo.todo_id} key={todo.todo_id}>{todo.todo_title}<button >Delete Todo</button></li>
                })}
                </ul>
            </div>
        )
    }

}

export default Card;
